import React from 'react';
import Pation from './Pation';
import Apointment from './Appointment';
import Drug from './Drug';


function Navbar() {
  return (

<nav>
<div className="logo">
<i class="fas fa-heartbeat"></i>
<h4> health</h4>
</div>
<ul className="navlinks">
     <li className="link"><a className="lin" href="#">patient</a></li>
     <li className="link"><a className="lin" href="#">home</a></li>
     <li className="link"><a className="lin" href="#">appointement</a></li>
     <li className="link"><a className="lin" href="#">drug</a></li>


</ul>
</nav>

  );
}

export default Navbar;
